import React from 'react';
import './GalleryMosaic.css';

export interface Item {
  src: string;
  alt: string;
  caption?: string;
}

interface Props {
  items?: Item[];
}

const GalleryMosaic: React.FC<Props> = ({ items = [] }) => {
  return (
    <div className="mosaic-container">
      {items.map((img, idx) => (
        <div key={idx} className="mosaic-item">
          <img src={img.src} alt={img.alt} loading="lazy" />
          {img.caption && <span className="mosaic-caption">{img.caption}</span>}
        </div>
      ))}
    </div>
  );
};

export default GalleryMosaic;
